import React from "react";
import './styles/schedule.css';
import Header from "../components/Header";
import Footer from "../components/Footer";
import Input from "../components/Input";
import Dropdown from "../components/Dropdown";

const Schedule = () => {
    return(
        <div className='Schedule bg-white'>
            <Header/>
            <div className='Schedule-first-block'>
                <div className='Schedule-first-block-img'/>
                <div className='Schedule-first-block-blur bg-darkBlue70'>
                    <h2 className='Display-1 tx-white'>Розклад</h2>
                </div>
            </div>
            <div className='Schedule-second-block'>
                <div className='Schedule-second-block-bg bg-lightF'>
                    <div className='Schedule-second-block-serch'>
                        <div className='Schedule-second-block-serch-1'>
                            <Input width={280} placeholder='Виберіть кабінет' type='text'/>
                        </div>
                        <div className='Schedule-second-block-serch-2'>
                            <Dropdown/>
                        </div>
                    </div>

                </div>
            </div>
            <Footer/>
        </div>
    );
};
export default Schedule;
